import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const PlantContainer = styled.div`
    max-width: 800px;
    margin: 4rem auto;
    padding: 2rem;
    background: white;
    border-radius: 10px;
    box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const PlantImage = styled.img`
    width: 100%;
    max-height: 400px;
    object-fit: cover;
    border-radius: 8px;
    margin-bottom: 1.5rem;
`;

const PlantTitle = styled.h2`
    color: #2c3e50;
    margin-bottom: 1rem;
    font-size: 2rem;
`;

const PlantDescription = styled.p`
    color: #34495e;
    margin-bottom: 1.5rem;
    line-height: 1.6;
`;

const InfoSection = styled.div`
    margin: 2rem 0;
`;

const SectionTitle = styled.h3`
    color: #2c3e50;
    margin-bottom: 1rem;
    font-size: 1.5rem;
`;

const List = styled.ul`
    list-style-type: none;
    padding: 0;
`;

const ListItem = styled.li`
    margin-bottom: 0.5rem;
    color: #34495e;
    padding-left: 1.5rem;
    position: relative;

    &:before {
        content: "•";
        color: #2ecc71;
        position: absolute;
        left: 0;
    }
`;

const NavigationButtons = styled.div`
    display: flex;
    justify-content: space-between;
    margin-top: 2rem;
`;

const NavButton = styled.button`
    padding: 0.5rem 1rem;
    background-color: #2ecc71;
    color: white;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    font-size: 1rem;
    transition: background-color 0.3s;

    &:hover {
        background-color: #27ae60;
    }

    &:disabled {
        background-color: #95a5a6;
        cursor: not-allowed;
    }
`;

const PlantOfTheDay = () => {
    const [currentPlantIndex, setCurrentPlantIndex] = useState(0);
    const [currentPlant, setCurrentPlant] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchPlant = async () => {
            try {
                setLoading(true);
                const response = await fetch(`https://perenual.com/api/species-list?page=${currentPlantIndex + 1}&key=YOUR_API_KEY`);
                if (!response.ok) throw new Error('Failed to fetch plant data');
                const data = await response.json();
                setCurrentPlant(data.data[0]);
                setError(null);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchPlant();
    }, [currentPlantIndex]);

    const handleNext = () => {
        setCurrentPlantIndex(prevIndex => prevIndex + 1);
    };

    const handlePrevious = () => {
        setCurrentPlantIndex(prevIndex => Math.max(0, prevIndex - 1));
    };

    if (loading) return <PlantContainer>Loading...</PlantContainer>;
    if (error) return <PlantContainer>Error: {error}</PlantContainer>;
    if (!currentPlant) return null;

    return (
        <PlantContainer>
            <PlantImage src={currentPlant.default_image?.thumbnail} alt={currentPlant.common_name} />
            <PlantTitle>{currentPlant.common_name}</PlantTitle>
            <PlantDescription>{currentPlant.description}</PlantDescription>
            
            <InfoSection>
                <SectionTitle>Scientific Name</SectionTitle>
                <p>{currentPlant.scientific_name}</p>
            </InfoSection>

            <InfoSection>
                <SectionTitle>Care Instructions</SectionTitle>
                <List>
                    <ListItem>Watering: {currentPlant.watering}</ListItem>
                    <ListItem>Sunlight: {currentPlant.sunlight}</ListItem>
                    <ListItem>Growth Rate: {currentPlant.growth_rate}</ListItem>
                </List>
            </InfoSection>

            <InfoSection>
                <SectionTitle>Characteristics</SectionTitle>
                <List>
                    <ListItem>Type: {currentPlant.type}</ListItem>
                    <ListItem>Hardiness Zone: {currentPlant.hardiness_zone}</ListItem>
                    <ListItem>Height: {currentPlant.height}</ListItem>
                    <ListItem>Spread: {currentPlant.spread}</ListItem>
                </List>
            </InfoSection>

            <NavigationButtons>
                <NavButton onClick={handlePrevious} disabled={currentPlantIndex === 0}>
                    Previous
                </NavButton>
                <NavButton onClick={handleNext}>
                    Next
                </NavButton>
            </NavigationButtons>
        </PlantContainer>
    );
};

export default PlantOfTheDay;
